class yTabManager{constructor(a){this.container=document.getElementById(a),this.tabs=this.container.getElementsByClassName("tab"),this.tabStack=[],this.currentTab=null;for(const b of this.tabs)"true"===b.dataset.default?(this.showTab(b.id),this.currentTab=b.id):this.hideTab(b.id)}hideTab(a){for(const b of this.tabs)b.id===a&&(b.style.display="none")}unhideTab(a){for(const b of this.tabs)b.style.display=b.id===a?"block":"none"}showTab(a){this.unhideTab(a),this.tabStack.push(this.currentTab),this.currentTab=a}closeTab(){const a=this.tabStack.pop();this.showTab(a)}}